import { UPDATE } from './../constants/scenarioAuditAction';

class SaveScenario {
  constructor(
    id = undefined,
    scenarioName = '',
    description = '',
    scenarioFile = undefined,
    auditList = undefined,
    shockClassification = 'Global',
    deltaComment = ''
  ) {
    this.id = id;
    this.scenarioName = scenarioName;
    this.description = description;
    this.scenarioFile = scenarioFile;
    this.auditList = auditList;
    this.shockClassification = shockClassification;
    this.deltaComment = deltaComment;
  }
}

export default SaveScenario;
